  return (
    <header>
      <nav>
        <ul>
          <li>
            <a href="#!">
              <i className="fas fa-home"></i>
            </a>
          </li>
          <li>
            <a href="#!">Login</a>
          </li>
        </ul>
      </nav>
    </header>
  );
};
